import axios from "axios";

function post_favorite(item, db) {
  axios.post("/favorites", { item, db });
}

function get_favorite(db) {
  return axios.get("/Favorites", {
    params: {
      db,
    },
  });
}

function deleteAll(db) {
  return axios.delete("/favorites", {params: {
    db,
  }})
}

export default {
  post_favorite,
  get_favorite,
  deleteAll,
};
